import React from 'react'

const commentList = ({data}) => {
  return (
    <div>
        {data.comments_list?.sort((a, b) => ( a.time.localeCompare(b.time) ))
        .map((comment) => (
            <div>
                {comment.username}
                <br/>
                {comment.comment}
            </div>
        ))}
    </div>
  )
}

export default commentList
